//NOTE: when overflow happens, the sign of the number will be changed
//but this function has no assertion about overflow
int32_t d2i(double value) {
    return fint(value*pow(BASE,EXPONENT));
}

double i2d(int32_t value) {
    return value/pow(BASE,EXPONENT);
}

bool overflow() {
    if((ix==INT32_MAX || ix==INT32_MIN)|| 
       (iy==INT32_MAX || iy==INT32_MIN)|| 
       (iz==INT32_MAX || iz==INT32_MIN)) {
        return true;
    }

    return false;
}

void reset() {
    ix = 0;
    iy = 0;
    iz = 0;
    x = 0;
    y = 0;
    z = 0;
}

void update() {    
    int i = 0, LEN = 0;
    double rx,ry,rz;
    double dx,dy,dz,step;
    double granularity = 0.01;

    // assign the continuous variables with the discrete variables' values
    rx = i2d(ix);
    ry = i2d(iy);
    rz = i2d(iz);
    // setup the granularity for calculating integration
    step = P*granularity;
    LEN = fint(1/granularity);
    // integration
    for(i=0;i<LEN;i++) {
        // small step of changing x
        dx = RATE*step;
        // add the small step to the real number of x
        rx = rx + dx;
        dy = sin(rx)*step;
        ry = ry + dy;
        dz = cos(rx)*step;
        rz = rz + dz;
    }
    // update discrete variables with the continuous variables' values
    ix = d2i(rx);
    iy = d2i(ry);
    iz = d2i(rz);

    if(overflow())
        reset();//when overflow occurs, continuous variables and discrete variables must be reset
}

